css:
.git-plus .alert {
  color: #f99157;
}
.git-plus .success {
  color: #99cc99;
}
.git-plus .overlay.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #6699cc;
}
.meta.diff.header {
  color: #6699cc;
}
.markup.deleted.diff {
  color: #f2777a;
}
.markup.inserted.diff {
  color: #99cc99;
}
